import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import Navbar from './components/Navbar';
import Footer from './components/footer';
import Home from './components/Home';
import Login from './auth/Login';
import Register from './auth/Register';
import PrivateRoute from './auth/PrivateRoute';
import PatientDashboard from './pages/PatientDashboard';
import MedecinDashboard from './pages/MedecinDashboard'; // ‚úÖ IMPORT NOUVEAU

// ‚úÖ DASHBOARDS TEMPORAIRES (remplacer par vos vrais composants)
const AdminDashboard = () => (
  <div style={{padding: '40px', background: '#fef5e7', minHeight: '80vh'}}>
    <h1 style={{fontSize: '48px', color: '#c2410c', textAlign: 'center'}}>
      üõ°Ô∏è ADMIN DASHBOARD - GOVAIMED
    </h1>
    <p style={{fontSize: '24px', textAlign: 'center', color: '#92400e'}}>
      Gestion compl√®te utilisateurs & RDV
    </p>
  </div>
);

function App() {
  return (
    <div className="min-h-screen flex flex-col">
      <Navbar />
      <main className="flex-grow">
        <Routes>
          {/* Pages publiques */}
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />

          {/* ‚úÖ TOUS LES R√îLES avec PrivateRoute - STRUCTURE CORRIG√âE */}
          <Route path="/patient/*" element={
            <PrivateRoute allowedRoles={['Patient']}>
              <PatientDashboard />
            </PrivateRoute>
          } />

          <Route path="/admin/*" element={
            <PrivateRoute allowedRoles={['Admin', 'SuperAdmin']}>
              <AdminDashboard />
            </PrivateRoute>
          } />

          {/* ‚úÖ M√âDECIN CORRIG√â - PAS DE Route imbriqu√©e ! */}
          <Route path="/medecin/*" element={
            <PrivateRoute allowedRoles={['Medecin']}>
              <MedecinDashboard />
            </PrivateRoute>
          } />

          <Route path="/moderateur/*" element={
            <PrivateRoute allowedRoles={['Moderateur']}>
              <AdminDashboard />
            </PrivateRoute>
          } />

          <Route path="/pharmacien/*" element={
            <PrivateRoute allowedRoles={['Pharmacien']}>
              <AdminDashboard />
            </PrivateRoute>
          } />

          <Route path="/service/*" element={
            <PrivateRoute allowedRoles={['Assistant', 'AideSoignant', 'Stagiaire', 'MediateurNumerique']}>
              <AdminDashboard />
            </PrivateRoute>
          } />

          <Route path="*" element={<Navigate to="/" replace />} />
        </Routes>
      </main>
      <Footer />
    </div>
  );
}

export default App;
